import React from "react";

const Range = () => {
  const handleRangeChange = (e) => {
    console.log(e.target.value);
  };

  return (
    <div style={{ maxWidth: 300, margin: 16 }}>
      <input
        type="range"
        class="form-range"
        onChange={handleRangeChange}
        name="priceRange"
      ></input>
    </div>
  );
};

export default Range;
